st_m = 0
st_v = 0

for key, value in zivali.items():
    if value[6] != None:
        if value[4] == 'Herbivore':
            rastlinojedci += value[6]
            st_r += 1
        if value[4] == 'Omnivore':
            vsejedci += value[6]
            st_v += 1
        if value[4] == 'Carnivore':
            mesojedci += value [6]
            st_m += 1

import matplotlib.pyplot as plt

tabela = [[rastlinojedci / st_r, 'Rastlinojedci'], [vsejedci / st_v, 'Vsejedci'], [mesojedci / st_m, 'Mesojedci']]
tabela.sort(reverse = True)
teze = [item[0] for item in tabela]
prehranjevanje = [item[1] for item in tabela]

fig = plt.figure(figsize = [12, 5])

plt.bar(prehranjevanje, teze, color = 'maroon', edgecolor = 'black')

plt.title("Povprečna teža glede na prehranjevanje", fontsize = 20, fontweight = 'bold')
plt.ylabel("Teža[kg]", fontsize = 15)
plt.xlabel("Tip prehranjevanja", fontsize = 15)
plt.close()

fig.savefig('AnalizaPrehranjevanja.pdf', bbox_inches = 'tight')